import Header from './components/Header'
import Footer from './components/Footer'
import List from './components/List'

class App extends Component {
    constructor(props){
        super(props)
        this.state={}
    }
    render() {
        return (
            <div>
              <Header></Header>
              <List></List>
              <Footer></Footer>
            </div>
        );
    }
}

export default App;
